import './App.css';
import { Routes, Route } from "react-router-dom";

import Home from 'views/home/Home';
import Services from 'views/home/Services';
import NotFound from 'views/errors/NotFound';
import Generic from 'views/errors/Generic';
import FormBase from 'views/formLayout/FormBase';
import PageBase from 'views/formLayout/PageBaseTest2';

function App() {
  return (
    <main className="App sectionOne" id="main" >
      <div className="container-fluid">
        <div className="row">
          <div className="col-md-8">

            <Routes>

              <Route exact path="/" element={<Home />} />

              <Route path="/Categories/:category" element={<Services />} />

              {/* Nested components get rendered inside each other (at the <Outlet />) */}
              <Route path=":form" element={<FormBase />}>
                <Route path=":page" element={<PageBase />} />
              </Route>

              {/* The list of error pages won't grow so can be explicit with routes */}
              <Route path="/ErrorNotFound" element={<NotFound />} />
              <Route path="/ErrorGeneric" element={<Generic />} />
              <Route path="/ErrorPageExpired" element={<NotFound />} />
              <Route path="/ErrorNotFound" element={<NotFound />} />
              <Route path="*" element={<NotFound />} />
            </Routes>

          </div>

          <div className="col-md-4">

          </div>
        </div>
      </div>
    </main>
  );
}

export default App;
